const CartItemStyles = styled.li`
    padding: 1rem 0;
    border-bottom: 1px solid var(--lightGrey);
    display: grid;
    grid-template-columns: : auto 1fr auto;
    img {
        margin-right: 1rem;
    }

`;

export default function CartItem({cartItem}) {
    return <CartItemStyles>{cartItem.id}</CartItemStyles>

}
